import React from "react";


function closePopup(){
    const popup = document.getElementsByClassName("popup")[0];
    popup.classList.toggle("visibilityPopup");
}

const Popup = (props) => {
    return (
        <div className="popup">
            <img className="image-github" alt="Github profile image" />
            <div className="section-popup">
                <h1 className="name-github">Emanuel dos Santos Paz</h1>
                <p>@devSantos16</p>
            </div>
            <a class="github-button" href="https://github.com/ntkme" data-size="large" data-show-count="true" aria-label="Follow @ntkme on GitHub">Follow @ntkme</a>
        <button  className="button-popup btn btn-primary">Fechar</button>
        </div>

    );
}
export default Popup;
